  count:1,
}

function App() {

/*   const [counter, setCounter] = useState(1); */

  var today = new Date(),
  date =  today.getDate();
  console.log(date);
  console.log(doordata);
  


  return (
    <>
    <body>
      <div id="grid">
        <h1 id="title">The blizzard</h1>
        <UserContext.Provider value={counter}>
        <TopRow/>
        <Door/>
        </UserContext.Provider>
      </div>
      </body>
    </>
  );
}

export default App;
